pytx.controller('SubmitTalkCtrl', function($scope, $location, $timeout, APIFactory) {
  $scope.APIService = new APIFactory('v1', $scope);
  $scope.set_title('Submit A Talk');
  $scope.closed = true;
  
  $scope.do_submit = function () {
    if ($scope.talkForm.$valid) {
      $scope.APIService.post_form('speakers/submit-talk', $scope.form)
        .success($scope.talk_accepted);
    }
    
    else {
      $scope.show_error('Invalid form data');
    }
  };
  
  $scope.talk_accepted = function () {
    $scope.thanks = true;
  };
  
  $scope.reset = function () {
    var searchObject = $location.search();
    $scope.thanks = false;
    $scope.form = {
      stype: searchObject.stype || 'talk-short',
      level: 'beginner'
    };
  };
  
  $scope.is_closed = function () {
    if ($scope.conf_obj) {
      if ($scope.conf_obj.cfp_open && $scope.conf_obj.cfp_closed) {
        var now = moment();
        var open = moment($scope.conf_obj.cfp_open);
        var closed = moment($scope.conf_obj.cfp_closed);
        
        if (open <= now && now <= closed) {
          return false;
        }
      }
    }
    
    else {
      $timeout($scope.page_checks, 300);
    }
    
    return true;
  };
  
  $scope.page_checks = function () {
    if ($scope.is_closed()) {
      
    }
    
    else if (!$scope.logged_in) {
      $location.url('/user/login?next=' + encodeURIComponent($location.path()));
    }
    
    //todo: redo with jwt
    //else if ($cookies.angular_logged_in != 'speaker') {
    //  $location.url('/user/my-profile?next=' + encodeURIComponent($location.path()));
    //}
    
    else {
      $scope.closed = false;
      $scope.reset();
    }
  };
  
  $scope.page_checks();
});

pytx.controller('ScheduleCtrl', function($scope, $routeParams, APIFactory) {
  $scope.APIService = new APIFactory('v1');
  $scope.set_title('Schedule');
  $scope.selectedIndex = 0;
  
  var today = new Date();
  
  $scope.load_schedule = function (data) {
    $scope.schedule = data;
    
    for (var i=0; i < $scope.schedule.length; i++) {
      var day = $scope.schedule[i];
      
      if (day.year == today.getFullYear() && day.month == (today.getMonth() + 1) && day.day == today.getDate()) {
        $scope.selectedIndex = i;
      }
      
      var pc = 50;
      
      if (day.rooms.length == 3) {
        pc = 33;
      }
      
      else if (day.rooms.length == 4) {
        pc = 25;
      }
      
      else if (day.rooms.length == 5) {
        pc = 20;
      }
      
      for (var j=0; j < day.hours.length; j++) {
        var hour = day.hours[j];
        var flexs = [];
        var flex_pc = pc;
        
        for (var f=1; f <= day.rooms.length; f++) {
          flexs.push(f);
        }
        
        for (var room_key in hour) {
          var r = hour[room_key];
          
          if (room_key == 'all') {
            r.flex_order = '';
            flex_pc = 100;
            flexs = [];
          }
          
          else {
            r.flex_order = day.rooms.indexOf(room_key) + 1;
            
            if (flexs.indexOf(r.flex_order) > -1) {
              flexs.splice(flexs.indexOf(r.flex_order), 1);
            }
          }
        }
        
        if (flexs.length > 0) {
          flex_pc = pc;
        }
        
        var h = {flexs: flexs, rooms: hour, flex_pc: flex_pc};
        day.hours[j] = h;
      }
    }
  };
  
  $scope.get_schedule = function () {
    $scope.APIService.get('speakers/schedule')
      .success($scope.load_schedule)
      .error(function () {
        $scope.show_error('Error Loading Schedule');
      });
  };
  
  $scope.get_schedule();
});

